/* 07-05 신희준 선임 코드 정리 및 함수 설명 주석*/
import React, { Component } from "react"
import { withStyles } from "@material-ui/core"
import Formsy from "formsy-react"
import { OwpDialog, OwpTextField, OwpSearchTextField,OwpButton }from 'owp/wrapper';
import axios from "axios"
import { mutate,query } from 'owp/api';
import moment from "moment"
import translationHelper from 'main/content/utils/translationHelper';
const pageID = 'C404000';

class Dialog_C0802005 extends Component {
  constructor(props) {
    super(props)

    this.state = {
      stateDialogReweighing: false
    }
  }


  openDialog_customer = () => {
      // console.log( this.props.dialogData);
      
    query({
        url: "loadOwpFacilitieshis/" + this.props.dialogData["OWP_FACILITIESHIS.FAC_HIS_SEQ"],
      }).then(res => {
        this.setState({
            stateDialogReweighing: true,
            FAC_HIS_CLASSIFICATION : res['OWP_FACILITIESHIS.FAC_HIS_CLASSIFICATIONNM'],
            FAC_HIS_CONTENTS : res['OWP_FACILITIESHIS.FAC_HIS_CONTENTS'],
            FAC_HIS_ID : res['OWP_FACILITIESHIS.FAC_HIS_ID'],
            FAC_HIS_LOCATION : res['OWP_FACILITIESHIS.FAC_HIS_LOCATION'],
            FAC_HIS_NM : res['OWP_FACILITIESHIS.FAC_HIS_NM'],
            FAC_HIS_SEQ : res['OWP_FACILITIESHIS.FAC_HIS_SEQ'],

            FAC_HIS_PRE_METHOD : res['OWP_FACILITIESHIS.FAC_HIS_PRE_METHOD'],
            FAC_HIS_STATUS : res['OWP_FACILITIESHIS.FAC_HIS_STATUS'],
            RDATE : moment(res['OWP_FACILITIESHIS.WDATE']).format("YYYY-MM-DD"),
            STARTTIME : moment(res['OWP_FACILITIESHIS.STARTTIME']).format("YYYY-MM-DD HH:mm:ss"),
            FINISHTIME : moment(res['OWP_FACILITIESHIS.FINISHTIME']).format("YYYY-MM-DD HH:mm:ss"),
            FAC_HIS_TROUBLE_PART : res['OWP_FACILITIESHIS.FAC_HIS_TROUBLE_PART'],
            FAC_HIS_TROUBLE_TIME : res['OWP_FACILITIESHIS.FAC_HIS_TROUBLE_TIME'],
            FAC_HIS_CAUSE : res['OWP_FACILITIESHIS.FAC_HIS_CAUSE'],
            FAC_HIS_WORKER : res['OWP_FACILITIESHIS.FAC_HIS_WORKER']
          });
    })
    .catch(error =>{
       console.error(error);
    })
      
  }

  closeDialog_customer = () => {
    //창닫기
    this.setState({ stateDialogReweighing: false })
  }

  render() {
    return (
      <div>
        <OwpDialog
          callbackFunction={this.openDialog_customer}
          onOpen={this.state.stateDialogReweighing}
          title={translationHelper(pageID +'.title.detail_dialog_title')}
          dialogActions={
            <React.Fragment>
              <OwpButton onClick={this.closeDialog_customer} variant="contained" color="primary">
              {translationHelper(pageID +'.buttons.dialog_close_button')}
              </OwpButton>
            </React.Fragment>
          }
          innerRef={ref => (this.owpDialog = ref)}
        >
          <React.Fragment>
            {/* <Formsy>
              <table
                style={{ width: "100%" }}
                className="table table-bordered table-advance table-hover tlw"
              >
                <tbody>
                  <tr>
                    <th className="bg_th" style={{ width: "110px" }}>
                      Registration Date
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
                      Preservation Method
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
                      History Classification
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
                      Facility Name
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
                      Facility No.
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
                      Trouble Parts
                    </th>
                    <th className="bg_th" style={{ width: "110px" }}>
